import axios from 'axios';
import React from 'react';

export default function GetTripData(){
    const {useState, useEffect} = React
    const [trips, setTrips] = useState([])

    useEffect(() => {
      axios
        .get("https://d6svkzibzlbl3o3cqf3bcg3aqu0ivhop.lambda-url.us-east-1.on.aws/")
        .then(res =>
          setTrips(res.data)
        )
    }, [])

    const data = trips
    return (
      trips.map(trip => 
        <h1> {trip.id} </h1>
      )
    )
  }
